function Login() {
  return (
    <div>
      <h2>Iniciar sesión</h2>
      <form onSubmit={handleSubmit}>
        <input placeholder="Username..." />
        <input placeholder="Password..." />
        <button>Iniciar sesión</button>
      </form>
    </div>
  )
}

export default Login
